import { useParams } from "react-router-dom";
import(useState)
import { Link } from "react-router-dom";

function Detailspage({ countries }) {
  const { countryCode } = useParams();
  const country = countries.find((country) => country.cca2 === countryCode);

  if (!country) {
    return <div>Country not found</div>;
  }

  return (
    <div>
      <Link to="/">
        <button>
          <span class="material-symbols-outlined">keyboard_backspace</span>Back
        </button>
      </Link>
      <div className="detailsMain">
        <div>
          <img className="imag" alt="flag" src={country.flags.png} />
        </div>
        <div>
          <h2>{country.name.common}</h2>
          <div className="smallerFlex">
            <div>
              {/* <p>Native Name: {country.name.nativeName[0]}</p> */}
              <p>Population: {country.population}</p>
              <p>Region: {country.region}</p>
              <p>Sub Region: {country.subregion}</p>
              <p>Capital: {country.capital[0]}</p>
            </div>
            <div>
              <p>Top Level Domain: {country.tld}</p>
              <p>Currencies: {}</p>
              <p>Languages: {}</p>
            </div>
          </div>
          <div>
            <p>Border Countries: </p>
          </div>
        </div>
      </div>
      {/* <h2>Country Details</h2>
      <h3>{country.name.common}</h3>
      <p>Capital: {country.capital}</p> */}
      {/* Display more details here */}
